/*Table structure for table `acct_receipt` */

DROP TABLE IF EXISTS `acct_receipt`;

CREATE TABLE `acct_receipt` (
  `receipt_id` bigint(22) NOT NULL AUTO_INCREMENT,
  `merchant_id` bigint(22) DEFAULT 0,
  `account_id` int(10) DEFAULT 0,
  `receipt_date` date DEFAULT NULL,
  `receipt_no` varchar(30) DEFAULT '',
  `receipt_title` varchar(250) DEFAULT '',
  `receipt_description` text DEFAULT NULL,
  `receipt_amount_total` decimal(20,2) DEFAULT 0.00,
  `receipt_token` char(70) DEFAULT '',
  `receipt_token_edit` char(70) DEFAULT '',
  `receipt_token_void` char(70) DEFAULT '',
  `data_state` int(1) DEFAULT 0,
  `created_id` int(10) DEFAULT 0,
  `created_on` datetime DEFAULT NULL,
  `voided_id` int(10) DEFAULT 0,
  `voided_on` datetime DEFAULT NULL,
  `voided_remark` text DEFAULT NULL,
  `last_update` timestamp NOT NULL DEFAULT current_timestamp(),
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`receipt_id`),
  KEY `FK_acct_receipt_account_id` (`account_id`),
  KEY `receipt_token` (`receipt_token`),
  KEY `receipt_token_edit` (`receipt_token_edit`),
  KEY `receipt_token_void` (`receipt_token_void`),
  KEY `data_state` (`data_state`),
  KEY `created_id` (`created_id`),
  KEY `FK_acct_receipt_merchant_id` (`merchant_id`),
  CONSTRAINT `FK_acct_receipt_merchant_id` FOREIGN KEY (`merchant_id`) REFERENCES `sales_merchant` (`merchant_id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `acct_receipt` */

/*Table structure for table `acct_receipt_item` */

DROP TABLE IF EXISTS `acct_receipt_item`;

CREATE TABLE `acct_receipt_item` (
  `receipt_item_id` bigint(22) NOT NULL AUTO_INCREMENT,
  `receipt_id` bigint(22) DEFAULT 0,
  `account_id` int(10) DEFAULT 0,
  `receipt_item_title` varchar(250) DEFAULT '',
  `receipt_item_amount` decimal(20,2) DEFAULT 0.00,
  `receipt_item_token` char(90) DEFAULT '',
  `receipt_item_token_edit` char(90) DEFAULT '',
  `receipt_item_token_void` char(90) DEFAULT '',
  `data_state` int(1) DEFAULT 0,
  `created_id` int(10) DEFAULT 0,
  `created_on` datetime DEFAULT NULL,
  `voided_id` int(10) DEFAULT 0,
  `voided_on` datetime DEFAULT NULL,
  `last_update` timestamp NOT NULL DEFAULT current_timestamp(),
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`receipt_item_id`),
  KEY `FK_acct_receipt_item_receipt_id` (`receipt_id`),
  KEY `FK_acct_receipt_item_account_id` (`account_id`),
  KEY `receipt_item_token` (`receipt_item_token`),
  KEY `receipt_item_token_edit` (`receipt_item_token_edit`),
  KEY `receipt_item_token_void` (`receipt_item_token_void`),
  KEY `data_state` (`data_state`),
  CONSTRAINT `FK_acct_receipt_item_receipt_id` FOREIGN KEY (`receipt_id`) REFERENCES `acct_receipt` (`receipt_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `acct_receipt_item` */

