/*Table structure for table `core_company` */

DROP TABLE IF EXISTS `core_company`;

CREATE TABLE `core_company` (
  `company_id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) DEFAULT 0,
  `product_type_id` int(11) DEFAULT 0,
  `product_version` int(11) DEFAULT 0,
  `company_name` varchar(100) DEFAULT '',
  `company_email` varchar(50) DEFAULT '',
  `company_address` text DEFAULT NULL,
  `company_phone_number` varchar(20) DEFAULT '',
  `company_mobile_number` varchar(20) DEFAULT '',
  `company_contact_person` varchar(20) DEFAULT '',
  `company_database` varchar(50) DEFAULT '',
  `item_picture` int(11) DEFAULT 0,
  `reseller_status` int(11) DEFAULT 0,
  `keep_status` int(11) DEFAULT 0,
  `item_category_name` varchar(20) DEFAULT '',
  `item_stock` int(11) NOT NULL DEFAULT 0,
  `data_state` int(11) DEFAULT 0,
  `created_id` int(11) DEFAULT 0,
  `created_on` datetime DEFAULT NULL,
  `last_balance` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`company_id`),
  KEY `company_id` (`company_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

