/* Trigger structure for table `acct_disbursement` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `insert_cash_disbursement` */$$

/*!50003 CREATE */ /*!50003 TRIGGER `insert_cash_disbursement` BEFORE INSERT ON `acct_disbursement` FOR EACH ROW BEGIN
	DECLARE year_period 		VARCHAR(20);
	DECLARE month_period 		VARCHAR(20);
	DECLARE period 			VARCHAR(20);
	DECLARE tPeriod			INT;
	DECLARE nDisbursementNo		VARCHAR(20);
	
		
	SET year_period = (SELECT YEAR(new.disbursement_date));
	
	SET month_period = (SELECT RIGHT(CONCAT('0', MONTH(new.disbursement_date)), 2));
	
	SET nDisbursementNo = CONCAT('CR', year_period, month_period);
		
	SET period = (SELECT RIGHT(TRIM(disbursement_no), 3) 
		FROM acct_disbursement
		WHERE LEFT(TRIM(disbursement_no), 8) = nDisbursementNo
		ORDER BY disbursement_id DESC 
		LIMIT 1);
	
	IF (period IS NULL ) THEN 
		SET period = "000";
	END IF;
	
	SET tPeriod = CAST(period AS DECIMAL(10));
	
	SET tPeriod = tPeriod + 1;
	
	SET period = RIGHT(CONCAT('000', TRIM(CAST(tPeriod AS CHAR(3)))), 3);
	
	SET nDisbursementNo = CONCAT(nDisbursementNo, period);
		
	SET new.disbursement_no = nDisbursementNo;
    END */$$


DELIMITER ;

/* Trigger structure for table `acct_receipt` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `insert_cash_receipt` */$$

/*!50003 CREATE */ /*!50003 TRIGGER `insert_cash_receipt` BEFORE INSERT ON `acct_receipt` FOR EACH ROW BEGIN
	DECLARE year_period 		VARCHAR(20);
	DECLARE month_period 		VARCHAR(20);
	DECLARE period 			VARCHAR(20);
	DECLARE tPeriod			INT;
	DECLARE nReceiptNo 		VARCHAR(20);
	
		
	SET year_period = (SELECT YEAR(new.receipt_date));
	
	SET month_period = (SELECT RIGHT(CONCAT('0', MONTH(new.receipt_date)), 2));
	
	SET nReceiptNo = CONCAT('CR', year_period, month_period);
		
