/* Trigger structure for table `core_supplier` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `insert_core_supplier` */$$

/*!50003 CREATE */ /*!50003 TRIGGER `insert_core_supplier` AFTER INSERT ON `core_supplier` FOR EACH ROW BEGIN
	DECLARE LAST INT;
	
	SELECT reference_counter INTO LAST 
		FROM preference_reference 
		WHERE reference_id = '1';
		
	UPDATE preference_reference SET reference_counter = LAST + 1 
		WHERE reference_id = '1';
		
	UPDATE preference_reference SET reference_last_digit_use = LAST + 1 
		WHERE reference_id = '1';
    END */$$


DELIMITER ;

/* Trigger structure for table `invt_goods_received_note` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `insert_inv_goods_received_note` */$$

/*!50003 CREATE */ /*!50003 TRIGGER `insert_inv_goods_received_note` BEFORE INSERT ON `invt_goods_received_note` FOR EACH ROW BEGIN
	DECLARE year_period 			VARCHAR(20);
	DECLARE month_period 			VARCHAR(20);
	DECLARE PERIOD 				VARCHAR(20);
	DECLARE tPeriod				INT;
	DECLARE nInvGoodsReceivedNoteNo		VARCHAR(20);
	DECLARE monthPeriod			VARCHAR(20);
	DECLARE lenInvGoodsReceivedNoteNo	DECIMAL(10);
	
	SET year_period = (YEAR(new.goods_received_note_date));
	
	SET month_period = (SELECT RIGHT(CONCAT('0', MONTH(new.goods_received_note_date)), 2));
	
	IF (month_period) = '01' THEN 
		SET monthPeriod = 'I';
	END IF;
	
	IF (month_period) = '02' THEN 
		SET monthPeriod = 'II';
	END IF;
	
	IF (month_period) = '03' THEN 
		SET monthPeriod = 'III';
	END IF;
	
	IF (month_period) = '04' THEN 
		SET monthPeriod = 'IV';
	END IF;	
	
	IF (month_period) = '05' THEN 
		SET monthPeriod = 'V';
	END IF;
	
	IF (month_period) = '06' THEN 
		SET monthPeriod = 'VI';
	END IF;
	
	IF (month_period) = '07' THEN 
		SET monthPeriod = 'VII';
	END IF;
	
	IF (month_period) = '08' THEN 
		SET monthPeriod = 'VIII';
	END IF;
	
	IF (month_period) = '09' THEN 
		SET monthPeriod = 'IX';
	END IF;
	
	IF (month_period) = '10' THEN 
		SET monthPeriod = 'X';
	END IF;
	
	IF (month_period) = '11' THEN 
		SET monthPeriod = 'XI';
	END IF;
	
	IF (month_period) = '12' THEN 
		SET monthPeriod = 'XII';
	END IF;
		
	SET PERIOD = (SELECT LEFT(TRIM(goods_received_note_no), 4) 
			FROM invt_goods_received_note
			WHERE RIGHT(TRIM(goods_received_note_no), 4) = year_period
			ORDER BY goods_received_note_id DESC 
			LIMIT 1);
		
	IF (PERIOD IS NULL ) THEN 
		SET PERIOD = "0000";
