DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `insert_invt_merchant_return_item` */$$

/*!50003 CREATE */ /*!50003 TRIGGER `insert_invt_merchant_return_item` BEFORE INSERT ON `invt_merchant_return_item` FOR EACH ROW BEGIN
	DECLARE nOpeningBalance 		DECIMAL(20,5);
	DECLARE nLastBalance	 		DECIMAL(20,5);
	DECLARE nItemID				INT(18);
	DECLARE nWarehouseID			INT(10);
	DECLARE nTransactionID			BIGINT(22);
	DECLARE nTransactionType		DECIMAL(10);
	DECLARE nTransactionCode		VARCHAR(20);
	DECLARE nTransactionDate		DATE;
	
	SET nWarehouseID	= (SELECT warehouse_id FROM invt_merchant_return WHERE merchant_return_id = new.merchant_return_id);
	
	
	SET nItemID = (SELECT item_id FROM invt_item_stock 	
				WHERE warehouse_id = nWarehouseID
				AND item_category_id = new.item_category_id
				AND item_id = new.item_id
				AND item_unit_id = new.item_unit_id_unit);
	
	SET nOpeningBalance = (SELECT last_balance FROM invt_item_stock 	
				WHERE warehouse_id = nWarehouseID
				AND item_category_id = new.item_category_id
				AND item_id = new.item_id
				AND item_unit_id = new.item_unit_id_unit);
				
	IF (nOpeningBalance IS NULL) THEN 
		SET nOpeningBalance = 0;
	END IF;
	
	SET nLastBalance = nOpeningBalance + new.quantity_unit;
	
	IF (nItemID IS NULL) THEN 
		INSERT INTO invt_item_stock (warehouse_id, item_category_id, 
			item_id, item_unit_id, item_default_quantity, last_balance)
			VALUES (nWarehouseID, new.item_category_id, 
			new.item_id, new.item_unit_id_unit, new.item_default_quantity, nLastBalance);
	ELSE	
		UPDATE invt_item_stock SET last_balance = nLastBalance 
					WHERE warehouse_id = nWarehouseID
					AND item_category_id = new.item_category_id
					AND item_id = new.item_id
					AND item_unit_id = new.item_unit_id_unit;
	END IF;
				
	SET nTransactionType 	= 24;
	
	SET nTransactionID 	= new.merchant_return_id;
	
	SET nTransactionCode 	= 'INVT_OUTLT_RET';
	
	SET nTransactionDate 	= (SELECT merchant_return_date FROM invt_merchant_return
					WHERE merchant_return_id = new.merchant_return_id);
	
	INSERT INTO invt_item_stock_card (warehouse_id, item_category_id, 
		item_id, item_unit_id, 
		transaction_id, transaction_type, transaction_code, transaction_date, 
		opening_balance, item_stock_card_in, item_default_quantity, last_balance)
		VALUES (nWarehouseID, new.item_category_id, 
			new.item_id, new.item_unit_id_unit, 
			nTransactionID, nTransactionType, nTransactionCode, nTransactionDate,
			nOpeningBalance, new.quantity_unit, new.item_default_quantity, nLastBalance);
    END */$$


