/*!50003 DROP FUNCTION IF EXISTS `getNewCodeAssetType` */;
DELIMITER $$

/*!50003 CREATE FUNCTION `getNewCodeAssetType`() RETURNS varchar(20) CHARSET latin1
BEGIN
	DECLARE digit INT;
