/*!50003 CREATE FUNCTION `getNewCodeWarehouseTransfer`(`whr` INT(10), `nosave` VARCHAR(20)) RETURNS varchar(20) CHARSET latin1
BEGIN
	DECLARE warehouse INT;
	DECLARE nomorada VARCHAR(20);
	DECLARE front VARCHAR(5);
	DECLARE cjt_one VARCHAR(5);
	DECLARE cjt_two VARCHAR(5);
	DECLARE cjt_three VARCHAR(5);
	DECLARE mdl_one VARCHAR(10);
	DECLARE mdl_two VARCHAR(10);
	DECLARE angkadepan VARCHAR(10);
	DECLARE p1 VARCHAR(10);
	DECLARE p2 VARCHAR(10);
	DECLARE new_id VARCHAR(20);
	DECLARE digit INT;
	DECLARE last INT;
	DECLARE mountuse INT;
	DECLARE panjanglast INT;
	DECLARE i int;
	SET warehouse = whr;
	SET nomorada = nosave;
	SELECT month_active INTO mountuse from preference_reference WHERE reference_id='11';
	IF(mountuse='')THEN 
	UPDATE preference_reference SET month_active=DATE_FORMAT(NOW(),'%m') WHERE reference_id='11'; 
	ELSEIF (mountuse<>DATE_FORMAT(NOW(),'%m'))THEN
	UPDATE preference_reference SET month_active=DATE_FORMAT(NOW(),'%m'), reference_last_digit='0', reference_last_digit_use='0' WHERE reference_id='11';
	END IF;
	SELECT front_code INTO front from preference_reference WHERE reference_id='11';
	SELECT conjunction_one INTO cjt_one from preference_reference WHERE reference_id='11';
	SELECT conjunction_two INTO cjt_two from preference_reference WHERE reference_id='11';
	SELECT conjunction_three INTO cjt_three from preference_reference WHERE reference_id='11';
	SELECT middle_one INTO mdl_one from preference_reference WHERE reference_id='11';
	SELECT middle_two INTO mdl_two from preference_reference WHERE reference_id='11';
	SELECT last_number INTO digit from preference_reference WHERE reference_id='11';
	SELECT reference_last_digit_use INTO last from preference_reference WHERE reference_id='11';
	
	IF(mdl_one='[BLN]')THEN
		SET mdl_one=DATE_FORMAT(NOW(),'%m');
	ELSEIF(mdl_one='[THN]')THEN
		SET mdl_one=DATE_FORMAT(NOW(),'%y');
	ELSEIF(mdl_one='[BLNTHN]')THEN
		SET mdl_one=DATE_FORMAT(NOW(),'%m%y');
	ELSEIF(mdl_one='[GD]')THEN
		SET mdl_one=warehouse;
	END IF;
	IF(mdl_two='[BLN]')THEN
		SET mdl_two=DATE_FORMAT(NOW(),'%m');
	ELSEIF(mdl_two='[THN]')THEN
		SET mdl_two=DATE_FORMAT(NOW(),'%y');
	ELSEIF(mdl_two='[BLNTHN]')THEN
		SET mdl_two=DATE_FORMAT(NOW(),'%m%y');
	ELSEIF(mdl_two='[GD]')THEN
		SET mdl_two=warehouse;
	END IF;
	SET p1='';
	SET i=1;
	ulang: WHILE i<=digit DO
		SET p1=CONCAT(p1, '0');
		SET i=i+1;
	END WHILE ulang;
	IF(nomorada<>'0')THEN
		SET last=SUBSTR(nomorada,LENGTH(nomorada),LENGTH(last));
		SET panjanglast=LENGTH(last);
		SET angkadepan=SUBSTR(p1,1,LENGTH(p1)-panjanglast);
		SET p2=CONCAT(angkadepan,last);
	ELSE
		IF(LENGTH(p1)<LENGTH(last)) THEN
			SET p2=last+1;
		ELSE
			SET panjanglast=LENGTH(last);
			SET angkadepan=SUBSTR(p1,1,LENGTH(p1)-panjanglast);
			SET p2=CONCAT(angkadepan,last+1);
		END IF;
	END IF;
	IF(nomorada='0')THEN
		UPDATE preference_reference SET reference_last_digit_use=last+1 WHERE reference_id='11'; 
	END IF;
	SET new_id=CONCAT(front,cjt_one,mdl_one,cjt_two,mdl_two,cjt_three,p2);
	
	RETURN new_id;
END */$$
DELIMITER ;

